import React from 'react'
import { Route, Switch, matchPath } from 'react-router-dom';
export default function index() {
    const Match = matchPath();
    console.log(Match)
    return (
        <Switch>
            <Route path={Match.url+'/:id'}>
                nguyen tan tan
            </Route>
            <Route path={Match.url+'/'}>
                ffffffdfdfdfd
            </Route>
        </Switch>
    )
}
